  display: flex;
  flex-direction: row;
`


const Home = ({ dispatch, theState }) => {
  console.log(theState);
  return (
    <PageContainer>
      <Room1 />
      <Room />
      <button
       onClick={() => dispatch(sampleAction("test"))}


     >
     Redux Test
    </button>
    </PageContainer>
  )
}

const mapStateToProps = (state, ownProps) => ({
  theState : state
})


export default connect(
  mapStateToProps
)(Home)
